import React, {useState} from 'react';


const createCalendar = () => {


    const [circle, setCircle] = useState('');
    const colors = ["green", "red", "blue", "purple"];
    return (
        <div>

            <div className='create-calendar-col'>
            <p className='cc-h1'>Create Calendar</p>

            <div className='cc-bubble'>
                <div className='cc-input-row'>
                    <input placeholder='Calendar Name' />
                    <input placeholder='description' />
                </div>
            </div>
            <div className='cc-comp-2'>
                <p className='cc-comp-title'>Customization</p>

                <div className='cc-comp-inner'>
                <p>Color</p>

                <div>
      {colors.map((color, index) => (
        <div
          key={index}
          style={{
            width: '50px',
            height: '50px',
            backgroundColor: color,
            margin: '5px',
            display: 'inline-block',
          }}
        ></div>
      ))}

      {circle && (
        <div>
          <p>You selected: {circle}</p>
          <div
            style={{
              width: '100px',
              height: '100px',
              backgroundColor: circle,
            }}
          ></div>
        </div>
      )}
    </div>

                <div>
                    <p>Location</p>
                    <input placeholder='description' />
                </div>
                </div>
            </div>

            <div className='create-calendar-cta'>
                <p>Create Calendar</p>
            </div>
            </div>

        </div>
    )
}

export default createCalendar;
